----------------------------------------------------------------------

-- Create the Global PLU Alignment Mapping Per IRMA Regional Instance

----------------------------------------------------------------------

IF EXISTS (SELECT 1 FROM [dbo].[Region] WHERE [RegionCode] NOT IN ('FL','MA','NA','EU','RM','NE'))


BEGIN

IF (EXISTS (SELECT * FROM INFORMATION_SCHEMA.TABLES WHERE TABLE_SCHEMA = 'dbo' AND TABLE_NAME = 'GlobalPluAlignment'))
		BEGIN
			DROP TABLE [dbo].[GlobalPluAlignment];
		END

END

GO

IF EXISTS (SELECT 1 FROM [dbo].[Region] WHERE [RegionCode] NOT IN ('FL','MA','NA','EU','RM','NE'))

BEGIN

CREATE TABLE [dbo].[GlobalPluAlignment]
		(
			[GlobalPluAlignmentId] [INT] IDENTITY(1,1) NOT NULL,
			[Region] [CHAR](2) NOT NULL,
			[RegionalPlu] [NVARCHAR](13) NOT NULL,
			[GlobalPlu] [NVARCHAR](13) NOT NULL,
			[Timestamp] [DATETIME] DEFAULT CURRENT_TIMESTAMP
		);

END

GO

