----------------------------------------------------------------------

-- count the Global PLU Alignment Mapping

----------------------------------------------------------------------

IF EXISTS (SELECT * FROM INFORMATION_SCHEMA.TABLES WHERE TABLE_SCHEMA = 'dbo' AND TABLE_NAME = 'GlobalPluAlignment')

BEGIN

	SELECT CONVERT(VARCHAR(255), COUNT(*)) AS 'dbo.GlobalPluAlignment' from dbo.GlobalPluAlignment

END

